#Viña Errázurriz
Partner.create(name: "Viña Errázurriz", email: "contacto@errazuriz.cl", area: "Vinos", liason_name: "María Jesus Astrain", liason_phone: "56988286727", liason_mail: "mjesus.astrain@vfch.cl", logo_url: "https://images.squarespace-cdn.com/content/v1/5e6fcd04db6a650dd89c8c20/1598648278157-7TPTCWDBUJ3TB3EEWF6I/image-asset.png?format=500w", web: "https://errazuriz.com/", fb: "https://www.facebook.com/errazurizwines/", ig: "https://www.instagram.com/errazurizwines/", description: "Don Maximiano Errázuriz fundó la Viña Errazuriz en 1870 con gran visión de futuro, espíritu innovador y pionero, plantó las primeras parras de vides francesas en el Valle de Aconcagua. Su empuje y creatividad se traspasaron a las futuras generaciones y, en poco más de un siglo, sus descendientes consolidaron la bodega y posicionaron sus vinos entre los más renombrados del mundo. Le invitamos a conocer aquí algunos de los principales hitos que han marcado la historia de esta viña familiar, actualmente uno de los principales referentes del exitoso sector vitivinícola de Chile.", address: "E-639 N°18", city: "Panquehue", state: "Valparaíso", phone: "56968464852" )

